const info = () => {


    return (
        <div className='info'>
          <div className='info'>
            <h1>Velkommen til vår chatbot!</h1>
            <p>Vi har designet denne boten for å hjelpe deg med å finne informasjon om Lillesand og Birkenes Kommune, våre ansatte og våre rutiner. Her er noen enkle trinn for å komme i gang:
                Start en samtale ved å si hei eller stille et spørsmål. Jeg vil prøve å svare på spørsmålet ditt eller hjelpe deg med å finne den informasjonen du trenger.

For å finne informasjon om Kommunene, kan du spørre om våre rutiner, hva vi gjør, våre mål og verdier.

Hvis du ønsker å finne informasjon om våre ansatte, kan du spørre om navnene deres, hvilke roller de har i organisasjonen og hva deres ansvarsområder er.

Hvis du vil vite mer om våre rutiner, kan du spørre om prosedyrer for bestilling, tidsplaner eller annen informasjon som du måtte trenge.

Hvis du noen gang trenger hjelp til å finne informasjon, ikke nøl med å spørre. Jeg er her for å hjelpe deg.

Vi håper du vil finne denne chatboten nyttig og at den vil gjøre det enklere for deg å finne informasjon.</p>
          </div>
        </div>

    );

    }

    export default info;
